/*# sourceMappingURL=feather.min.js.map */
$(function () {
    "use strict";
    
    $(".preloader").fadeOut();
    
    /* Feather Icon Init Js */
    feather.replace();
    
    $(".left-sidebar").hover(
        function () {
            $(".navbar-header").addClass("expand-logo");
        },
        function () {
            $(".navbar-header").removeClass("expand-logo");
        }
    );
    /* this is for close icon when navigation open in mobile view */
    $(".nav-toggler").on('click', function () {
        $("#main-wrapper").toggleClass("show-sidebar");
        $(".nav-toggler i").toggleClass("ti-menu");
    });
    $(".nav-lock").on('click', function () {
        $("body").toggleClass("lock-nav");
        $(".nav-lock i").toggleClass("mdi-toggle-switch-off");
        $("body, .page-wrapper").trigger("resize");
    });
    $(".search-box a, .search-box .app-search .srh-btn").on('click', function () {
        $(".app-search").toggle(200);
        $(".app-search input").focus();
    });
    
    /* ===================== */
    /* Right sidebar options */
    /* ===================== */
    $(function () {
        $(".service-panel-toggle").on('click', function () {
            $(".customizer").toggleClass('show-service-panel');

        });
        $('.page-wrapper').on('click', function () {
            $(".customizer").removeClass('show-service-panel');
        });
    });
    /* =============================== */
    /* This is for the floating labels */
    /* =============================== */
    $('.floating-labels .form-control').on('focus blur', function (e) {
        $(this).parents('.form-group').toggleClass('focused', (e.type === 'focus' || this.value.length > 0));
    }).trigger('blur');

    /* ======= */
    /* Tooltip */
    /* ======= */
    $(function () {
        /* $('[data-bs-toggle="tooltip"]').tooltip(); */
    
        /* Enable tooltips everywhere (Default trigger: 'hover focus') */
        var tooltipTriggerList = [].slice.call(document.querySelectorAll('[data-bs-toggle="tooltip"]'));
        var tooltipList = tooltipTriggerList.map(function (tooltipTriggerEl) {
            return new bootstrap.Tooltip(tooltipTriggerEl);
        });
    });
    
    $(function () {
        /* Enable tooltips everywhere (Default trigger: 'hover') */
        var tooltipHoverTriggerList = [].slice.call(document.querySelectorAll('[data-bs-toggle="tooltipHover"]'));
        var tooltipHoverList = tooltipHoverTriggerList.map(function (tooltipTriggerEl) {
            return new bootstrap.Tooltip(tooltipTriggerEl, {
                trigger : 'hover'
            });
        });
    });
    /* ======= */
    /* Popover */
    /* ======= */
    $(function () {
        /* $('[data-bs-toggle="popover"]').popover(); */
        var popoverTriggerList = [].slice.call(document.querySelectorAll('[data-bs-toggle="popover"]'));
        var popoverList = popoverTriggerList.map(function (popoverTriggerEl) {
            return new bootstrap.Popover(popoverTriggerEl, {
                html: true
            });
        });
    });

    /* ================= */
    /* Perfect scrollbar */
    /* ================= */
    $('.message-center, .customizer-body, .scrollable').perfectScrollbar({
        wheelPropagation: !0
    });

    /*
    var ps = new PerfectScrollbar('.message-body');
    var ps = new PerfectScrollbar('.notifications');
    var ps = new PerfectScrollbar('.scroll-sidebar');
    var ps = new PerfectScrollbar('.customizer-body');
    */

    /* =================== */
    /* Resize all elements */
    /* =================== */
    $("body, .page-wrapper").trigger("resize");
    $(".page-wrapper").delay(20).show();

    /* ========== */
    /* To do list */
    /* ========== */
    $(".list-task li label").click(function () {
        $(this).toggleClass("task-done");
    });

    /* ================= */
    /* Collapsable cards */
    /* ================= */
    $('a[data-action="collapse"]').on('click', function (e) {
        e.preventDefault();
        $(this).closest('.card').find('[data-action="collapse"] i').toggleClass('ti-minus ti-plus');
        $(this).closest('.card').children('.card-body').collapse('toggle');
    });
    /* Toggle fullscreen */
    $('a[data-action="expand"]').on('click', function (e) {
        e.preventDefault();
        $(this).closest('.card').find('[data-action="expand"] i').toggleClass('mdi-arrow-expand mdi-arrow-compress');
        $(this).closest('.card').toggleClass('card-fullscreen');
    });
    /* Close Card */
    $('a[data-action="close"]').on('click', function () {
        $(this).closest('.card').removeClass().slideUp('fast');
    });
    /* ====================== */
    /* LThis is for mega menu */
    /* ====================== */
    $(document).on('click', '.mega-dropdown', function (e) {
        e.stopPropagation()
    });
    /* ================== */
    /* Last month earning */
    /* ================== */
    $('#monthchart').sparkline([5, 6, 2, 9, 4, 7, 10, 12], {
        type: 'bar',
        height: '35',
        barWidth: '4',
        resize: true,
        barSpacing: '4',
        barColor: '#1e88e5'
    });
    $('#lastmonthchart').sparkline([5, 6, 2, 9, 4, 7, 10, 12], {
        type: 'bar',
        height: '35',
        barWidth: '4',
        resize: true,
        barSpacing: '4',
        barColor: '#7460ee'
    });
    var sparkResize;

    /* ================================= */
    /* This is for the innerleft sidebar */
    /* ================================= */
    $(".show-left-part").on('click', function () {
        $('.left-part').toggleClass('show-panel');
        $('.show-left-part').toggleClass('ti-menu');
    });

    /* For Custom File Input */
    $('.custom-file-input').on('change', function () {
        /* get the file name */
        var fileName = $(this).val();
        /* replace the "Choose a file" label */
        $(this).next('.custom-file-label').html(fileName);
    })
});
